import React from "react";
import { Navbar, Container, Nav } from "react-bootstrap";

export default function Header(props: any) {
    return (
        <header className="row block center">
        <div>
            <a href="#/">
                <h1>Shopping</h1>
            </a>
        </div>
        <div>
            <a href="#/cart">Cart</a>
        </div>
        </header>
    )
}
